import React, {Component} from 'react';
import { NavLink, Route } from "react-router-dom";
import UserProfile from './UserProfile';
import UserTests from "./UserTests";
import {Redirect} from "react-router";
import styled from 'styled-components';

const AllDiv = styled.div`
	margin-top: 30px;
	font-size: 16px;
    padding-bottom: 10px;
   
`;
const LinkDiv = styled(NavLink)`
    display: inline-block;
    color: #201C16; 
    text-decoration: none;
    :hover, :active {
        text-decoration: underline;
    }
`;
const Main = styled.div`
    margin: auto;
    max-width: 1200px;
    color: rgba(16, 5, 41, 1);
    overflow: auto;
`;
const FlexRow = styled.div`
	display: flex;
	flex-direction: ${props => props.dir || 'row'};
	flex-wrap: wrap;
	width: ${props => props.width || '100%'};
	height: ${props => props.height || '100%'};
	box-sizing: border-box;

	@media screen and (max-width: 1190px) {
		flex-direction: column;
		min-width: 100%;
	}
`;
const FlexChild = styled.div`
	width:  ${props => props.width || '25%'};
	box-sizing: border-box;
		   
	@media screen and (max-width: 1190px) {
		margin: 5px;
		min-width: 100%;
	}
`;

const TestTitle = styled.div`
    font-size: 34px;
    color: #4F9DA6;
    font-weight: bold;
    margin-bottom: 16px;
`;
const Title = styled.div`
    width: 100%;
    margin: 30px 0;
    font-size: ${props => props.size || '34px'};  
    color:rgba(79, 157, 166, 1);
    border-bottom: 1px solid rgba(220, 220, 220, 1);
`;
const Score = styled.div`
    width: 100%;
    padding-bottom: 30px;
    margin-bottom: 30px;
    border-bottom: 1px solid #DCDCDC;
    font-size: 48px;
    color: #4F9DA6;
    box-sizing: border-box;

    @media screen and (max-width: 1190px) {
		margin: 5px;
		min-width: 100%;
	}
`;
const Square = styled.span`
    display: inline-block;
    width: 12px;
    height: 12px;
    background-color: #4F9DA6;

`;
const TestDescription= styled.div`
    font-size: 24px;
    color: #FFAD5A;
    margin-bottom: 16px;

`;
const PassingDescription = styled.div`
    font-size: 24px;
    color: #141218;
    margin-bottom: 16px;

`;
const TestDetails = styled.span`
    display: inline-block;
    margin-left: 8px;
    font-size: 16px;
`;
const TestDetailsValue = styled.span`
    display: inline-block;
    margin-left: 8px;
    margin-right:30px;
    font-size: 16px;
    color:#FFAD5A; 
`;

const Button = styled.button`
    display: block;
    margin: 32px 0;
    padding: 16px 18px;
    border: 0;
    border-radius: 4px;
    background-color:rgba(255, 89, 89, 1);
	color: white;
	box-shadow: 0px 3px 6px rgba(0, 0, 0, 0.16);
    font-weight: bold;
    font-size: 20px;
    box-sizing: border-box;
`;

export default class StartTest extends Component {
	constructor(props){
		super(props)
	}
	render(){
		return(
            <>
            <Main>
            <AllDiv>
                <LinkDiv to={`/profile`}> My Account </LinkDiv> 
                    /{' '}
                Start tests 
            </AllDiv>
            <Title>Start Test</ Title>
            
               
            <FlexRow>
                <FlexChild width={'146px'}>
                    Logo
                </FlexChild>
                <FlexChild width={'calc(100% - 354px)'}>
                    <TestTitle>JS Foundation</TestTitle>
                    <TestDescription>JS Foundation</TestDescription>
                    <PassingDescription>You can take the test once.
                        If you stop the test in the middle, you will get as much as you managed to score. 
                    </PassingDescription>
                    < Square />  
                    <TestDetails>Number of questions : </TestDetails>
                    <TestDetailsValue>10</TestDetailsValue>
                    < Square />  
                    <TestDetails>Time : </TestDetails>
                    <TestDetailsValue>30 minutes</TestDetailsValue>
                    < Square />  
                    <TestDetails>Score : </TestDetails>
                    <TestDetailsValue>30 points</TestDetailsValue>
                    <Button>Start test></Button>
                </FlexChild>
            </FlexRow>
        </Main>
        </>
        );
	}
}
